 @humsyoonbhadelia8440  “The closest of people to me on the Day of Resurrection will be those who sent the most blessings upon me.”

It was narrated from ‘Abdullah ibn Mas‘ood (may Allah be pleased with him) that the Messenger of Allah (blessings and peace of Allah be upon him) said: “The closest of people to me on the Day of Resurrection will be those who sent the most blessings upon me.”

Narrated by at-Tirmidhi (484). He said: This is a ghareeb hasan hadith. It was classed as Sahih by Ibn Hibbaan, as was narrated from him by al-Haafiz ibn Hajar in Buloogh al-Maraam (455). It was classed as hasan by al-Haafiz ibn Hajar in Nataa’ij al-Afkaar (3/295). It was also classed as hasan because of corroborating evidence by Shaykh al-Albaani in Sahih at-Targheeb (1668).
